update Student
set SchoolName = (select Name from School except select Name from School where Name = 'dummySchool' order by rand() limit 1);

set foreign_key_checks = 0;

update Learns_In
set ClassID = (
    select ClassID 
    from ClassInSchool
    natural join Teacher 
    natural join Student 
    where Student.SchoolName = Teacher.SchoolName 
    order by rand() 
    limit 1
);
set foreign_key_checks = 1;
